/*Table structure for table `transaksi_beli` */

DROP TABLE IF EXISTS `transaksi_beli`;

CREATE TABLE `transaksi_beli` (
  `ID_TB` varchar(20) NOT NULL,
  `ID_PEMBELI` varchar(20) NOT NULL,
  `TANGGAL_TRANSAKSI` date NOT NULL,
  `SUBTOTAL_TRANSAKSI` int unsigned NOT NULL,
  `PAKE_POIN` int unsigned DEFAULT NULL,
  `TANGGAL_KIRIM` date NOT NULL,
  `NOTES_PESAN` varchar(255) DEFAULT NULL,
  `ALAMAT` varchar(100) NOT NULL,
  `ONGKIR` int unsigned NOT NULL,
  `TOTAL_BAYAR` int unsigned NOT NULL,
  `CARA_PEMBAYARAN` varchar(50) NOT NULL,
  `DAPET_POIN` int unsigned NOT NULL,
  `STATUS_PESANAN` varchar(100) NOT NULL,
  `TB_DELETE` varchar(1) NOT NULL,
  PRIMARY KEY (`ID_TB`),
  KEY `FK_MELAKSANAKAN` (`ID_PEMBELI`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

